/*Table structure for table `tb_consignee` */

DROP TABLE IF EXISTS `tb_consignee`;

CREATE TABLE `tb_consignee` (
  `cid` int(11) NOT NULL auto_increment COMMENT '收货人编码，主键自增',
  `cname` varchar(10) NOT NULL default '' COMMENT '收货人姓名',
  `cphone` varchar(11) NOT NULL COMMENT '收货人手机号',
  `caddress` varchar(100) NOT NULL COMMENT '收货人地址',
  `ccity` varchar(30) NOT NULL default '' COMMENT '收货人所在县/市',
  PRIMARY KEY  (`cid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

