/*Table structure for table `tb_order` */

DROP TABLE IF EXISTS `tb_order`;

CREATE TABLE `tb_order` (
  `oid` varchar(50) NOT NULL default '' COMMENT '订单流水号，uuid',
  `uid` int(11) NOT NULL COMMENT '用户编码',
  `wid` int(11) NOT NULL COMMENT '服务的员工编码',
  `cid` int(11) NOT NULL COMMENT '收货人的编码',
  `hid` int(11) NOT NULL COMMENT '仓库的编码',
  `starttime` date default NULL COMMENT '订单开始时间',
  `endtime` date default NULL COMMENT '订单的结束时间',
  `status` int(1) NOT NULL default '0' COMMENT '订单的完成状态（0未完成，1完成）',
  `audit` int(1) NOT NULL default '0' COMMENT '订单是否审核通过（0正在审核，1未通过审核，2表示通过审核）',
  `items` varchar(20) default '' COMMENT '订单寄存物品',
  `items_img` varchar(300) NOT NULL default '' COMMENT '订单寄存物品的图片',
  `otype` varchar(10) NOT NULL default '自行取件' COMMENT '订单的服务类型',
  `cmessage` varchar(50) default NULL COMMENT '订单的备注',
  PRIMARY KEY  (`oid`),
  KEY `uid` (`uid`),
  KEY `wid` (`wid`),
  KEY `cid` (`cid`),
  KEY `hid` (`hid`),
  CONSTRAINT `tb_order_ibfk_1` FOREIGN KEY (`uid`) REFERENCES `tb_user` (`uid`),
  CONSTRAINT `tb_order_ibfk_2` FOREIGN KEY (`wid`) REFERENCES `tb_worker` (`wid`),
  CONSTRAINT `tb_order_ibfk_3` FOREIGN KEY (`cid`) REFERENCES `tb_consignee` (`cid`),
  CONSTRAINT `tb_order_ibfk_4` FOREIGN KEY (`hid`) REFERENCES `tb_warehouse` (`hid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

