/*Table structure for table `tb_uc` */

DROP TABLE IF EXISTS `tb_uc`;

CREATE TABLE `tb_uc` (
  `uid` int(11) default NULL COMMENT '用户编码',
  `cid` int(11) default NULL COMMENT '收货人编码',
  KEY `uid` (`uid`),
  KEY `cid` (`cid`),
  CONSTRAINT `tb_uc_ibfk_1` FOREIGN KEY (`uid`) REFERENCES `tb_user` (`uid`),
  CONSTRAINT `tb_uc_ibfk_2` FOREIGN KEY (`cid`) REFERENCES `tb_consignee` (`cid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

