/*Table structure for table `tb_user` */

DROP TABLE IF EXISTS `tb_user`;

CREATE TABLE `tb_user` (
  `uid` int(11) NOT NULL auto_increment COMMENT '用户编码，主键自增',
  `uname` varchar(10) NOT NULL default '' COMMENT '用户姓名',
  `pwd` varchar(50) NOT NULL COMMENT '用户密码',
  `security1` varchar(50) NOT NULL COMMENT '密保问题1',
  `answer1` varchar(10) NOT NULL COMMENT '答案1',
  `security2` varchar(50) NOT NULL COMMENT '密保问题2',
  `answer2` varchar(10) NOT NULL COMMENT '答案2',
  `phone` varchar(11) NOT NULL COMMENT '手机号码',
  `img_head` varchar(100) NOT NULL default '' COMMENT '用户头像',
  PRIMARY KEY  (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

